    <script>
    	//Linje nummer minus 67
        var defaultE = 767;

        var select = document.getElementById("select");
        var timeplan = document.getElementById("timeplan");
        var hEl = document.getElementById("uke");
        var selectE = document.getElementById("elev");

        selectE.options[defaultE].selected = "selected";
        select.options[parseInt(getWeek()-1)].selected = "selected";

        var windowWidth = parseInt(window.innerWidth);
        var windowHeight = parseInt(window.innerHeight);
        var margin = parseInt(windowWidth*0.1);


        function setTimeplan(){
            uke = select.value;
            elev = selectE.value;

            timeplan.src = "http://www.novasoftware.se/ImgGen/schedulegenerator.aspx?format=png&schoolid=60870/nb-no&type=3&id="+elev+"&period=&week="+uke+"&mode=0&printer=0&colors=32&head=0&clock=0&foot=0&day=0&width="+(windowWidth-20)+"&height="+(windowHeight-200)+"&maxwidth="+(windowWidth-20)+"&maxheight="+(windowHeight-200);
            hEl.innerHTML = "Uke: "+uke;
        }

        function getWeek(){
            var maanedDager = [[0,0],[31,31],[60,59],[91,90],[121,120],[152,251],[182,181],[213,212],[244,243],[274,273],[305,304],[335,334]];
            var date = new Date();
            var maaned = Number(date.getMonth());
            var dag = Number(date.getDate());
            var uke;

            if(Number(date.getFullYear())%4 === 0){
                var dagerSidenStart = maanedDager[maaned][0] + dag;
                uke = dagerSidenStart / 7;
            } else{
                var dagerSidenStart = maanedDager[maaned][1] + dag;
                uke = dagerSidenStart / 7;
            }

            return (parseInt(uke+1)).toString();
        }

        setTimeplan();
    </script>
